import React from "react";
import { BrowserRouter, Router, Route } from "react-router-dom";

import Home from "./components/Home";
import Navbar from "./components/Navbar";

function App() {
  return (
    <>
      <BrowserRouter>
        <Router>
          <p>The Wild List by Emma and Antony</p>
          <Route>
            <Home />
          </Route>
          <Route>
            <Navbar />
          </Route>
        </Router>
      </BrowserRouter>
    </>
  );
}

export default App;
